DEBUG - 2025-06-08 11:41:03 --> SQL Query for get_ujian_by_id_with_guru: SELECT `m_ujian`.*, `mapel`.`nama_mapel`, `g1`.`nama_guru` as `pembuat_soal`, `jenjang`.`nama_jenjang`, (
            SELECT GROUP_CONCAT(DISTINCT g_pengajar.nama_guru ORDER BY g_pengajar.nama_guru ASC)
            FROM guru_mapel_kelas_ajaran gmka_pengajar
            JOIN guru g_pengajar ON gmka_pengajar.guru_id = g_pengajar.id_guru
            WHERE gmka_pengajar.mapel_id = m_ujian.mapel_id
            AND gmka_pengajar.id_tahun_ajaran = m_ujian.id_tahun_ajaran AND gmka_pengajar.kelas_id = '3') AS nama_guru_pengajar
FROM `m_ujian`
JOIN `mapel` ON `mapel`.`id_mapel` = `m_ujian`.`mapel_id`
JOIN `guru` `g1` ON `g1`.`id_guru` = `m_ujian`.`guru_id`
LEFT JOIN `jenjang` ON `jenjang`.`id_jenjang` = `m_ujian`.`id_jenjang_target`
WHERE `m_ujian`.`id_ujian` = '1'
